import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import store from './Readux/redux-store'
import {BrowserRouter} from "react-router-dom";

    ReactDOM.render(
        <BrowserRouter>
            +            <Provider store={store}>
            +                <App/>
            +            </Provider>
        </BrowserRouter>,
        document.getElementById('root')
    )
